DROP TABLE product CASCADE CONSTRAINTS;
DROP TABLE customer CASCADE CONSTRAINTS;
DROP TABLE employee CASCADE CONSTRAINTS;
DROP TABLE Transaction_DealWith_Pay CASCADE CONSTRAINTS;
DROP TABLE Include CASCADE CONSTRAINTS;
DROP TABLE Member CASCADE CONSTRAINTS;
SET DEFINE OFF;

create table product (
  P_id varchar(10) not null PRIMARY KEY,
  Category varchar(50),
  SalePrice float,
  PurchasePrice float,
  Inventory integer,
  P_name varchar(200),
  P_size varchar(20),
  color varchar(20),
  rating float,
  BrandName varchar(50),
  thumbnail varchar(200)
);

CREATE table customer(
  Email varchar(50) NOT NULL  PRIMARY KEY ,
  c_name varchar(40),
  address varchar(100),
  password varchar(30)
);

CREATE table employee (
  E_id varchar(8) not null PRIMARY KEY,
  E_name varchar(40),
  salary float,
  startDate varchar(10),
  E_type varchar(10),
  password varchar(30)
);

CREATE TABLE Transaction_DealWith_Pay (
  TransactionNum VARCHAR(10) NOT NULL PRIMARY KEY,
  dateTime     VARCHAR(20),
  PaymentMethod VARCHAR(20),
  email        VARCHAR(50),
  e_id         VARCHAR(8),
  total       FLOAT,
  FOREIGN KEY (email) REFERENCES Customer ON DELETE SET NULL ,
  FOREIGN KEY (e_id) REFERENCES Employee ON DELETE SET NULL
);

CREATE TABLE Include (
  TransactionNum VARCHAR(10),
  P_id VARCHAR(10),
  Quantity INTEGER,
  PRIMARY KEY (TransactionNum, P_id),
  FOREIGN KEY (TransactionNum) REFERENCES Transaction_DealWith_Pay ON DELETE CASCADE ,
  FOREIGN KEY (P_id) REFERENCES Product ON DELETE SET NULL
);

CREATE TABLE Member (
  Email VARCHAR(50) NOT NULL PRIMARY KEY ,
  Points integer,
  rewardRate FLOAT,
  FOREIGN KEY(Email) REFERENCES Customer ON DELETE CASCADE
);

